export function getProblemState(
  isFrozen: boolean,
  solution?: string,
  current_response?: FTML.ProblemResponse
): FTML.ProblemState {
  if (!isFrozen) return { type: "Interactive", current_response, solution: undefined };
  if (!solution) return { type: "Finished", current_response };
  const sol = FTML.Solutions.from_jstring(solution.replace(/^"|"$/g, ""));
  const feedback = current_response
    ? sol?.check_response(current_response)
    : sol?.default_feedback();
  if (!feedback) return { type: "Finished", current_response }; // Backup: if something goes wrong.
  return { type: "Graded", feedback: feedback };
}

const getProblemsStates = (
  problemUris: string[],
  solutions: Record<DocumentElementUri, string>
) => {
  const states = new Map<FTML.DocumentElementUri, FTML.ProblemState>();
  for (const uri of problemUris) {
    const solution = solutions[uri];
    const state = getProblemState(true, solution);
    states.set(uri, state);
  }
  return states;
};

